import MyContent from "../components/mycontent/MyContent";
import React from 'react'

const MyContentPage = ({isSign, blogData}) => {
  return (
    <>
    <MyContent isSign={isSign} blogData={blogData}/>
    </>
  )
}

export default MyContentPage
